import React, {Component} from 'react';
import './App.css';
import ParticlesBg from 'particles-bg';
import Navigation from './Components/Navigation/Navigation';
import URLinput from './Components/URLinput/URLinput';
import Rank from './Components/Rank/Rank';
import FaceRecognition from './Components/FaceRecognition/FaceRecognition';
import Clarifai from 'clarifai';






/////////////////////////////////////////////////////////////////////////////////

class App extends Component {
  constructor() {
    super()
    this.state = {
      input: '',
      imageUrl: ''
    }
  }

  onInputChange = (event) => {
    this.setState({input: event.target.value});
  }

  onButtonSubmit = () => {
    //CLARIFAI API INTEGRATION
    const PAT = 'af3372ee16b04b788518c454dd35f8f9'; //correct
    const USER_ID = 'calvinyoon'; //correct
    const APP_ID = 'my-first-application'; //correct
    const MODEL_ID = 'f76196b43bbd45c99b4f3cd8e8b40a8a';
    // 'f76196b43bbd45c99b4f3cd8e8b40a8a' 
    //'6dc7e46bc9124c5c8824be4822abe105' //per clarifai.com? or Clarifai.FACE_DETECT_MODEL 'a403429f2ddf4b49b307e318f00e528b';
    //const IMAGE_URL = 'https://samples.clarifai.com/face-det.jpg'

    const raw = JSON.stringify({
        "user_app_id": {
            "user_id": USER_ID,
            "app_id": APP_ID
        },
        "inputs": [
            {
                "data": {
                    "image": {
                        "url": this.state.input
                    }
                }
            }
        ]
    });

    const requestOptions = {
        method: 'POST',
        headers: {
            'Accept': 'application/json',
            'Authorization': 'Key ' + PAT
        },
        body: raw
    };



    this.setState({imageUrl: this.state.input})
    fetch("https://api.clarifai.com/v2/models/" + MODEL_ID + "/outputs", requestOptions)
    .then( //THIS DOESNT WORKKKKK
      function(response) {
        response.text(); //.outputs[0].data.regions[0].region_info.bounding_box
      }
    )
    .then(
      function(result) {
        console.log(result);
      }
    );

    //model 6dc7e46bc9124c5c8824be4822abe105 api af3372ee16b04b788518c454dd35f8f9
  }

  render() {
    return (
      <div className="App">
        <ParticlesBg type="cobweb" color="#ffffff" bg={{position: "fixed", left: 0, top: 0}} className="particles-bg"/>
        <Navigation />
        <Rank />
        <URLinput onInputChange={this.onInputChange} onButtonSubmit={this.onButtonSubmit}/>
        <FaceRecognition imageUrl={this.state.imageUrl} />
      </div>
    );
  }
}

export default App;
